import { useState, useEffect } from "react";

function Data() {
    const [launchesApi, setlaunchesApi] = useState([]);
    const launchesData = [
        {
            id: 1,
            rocket: "",
            misionName: "",
            time: ""
        },
        {
            id: 2,
            rocket: "",
            misionName: "",
            time: ""
        },
        {
            id: 3,
            rocket: "",
            misionName: "",
            time: ""
        }
    ];

    const request = async () => {
        const response = await fetch('https://lldev.thespacedevs.com/2.0.0/launch/upcoming/');
        const json = await response.json();
        console.log(json);
        
        useEffect(() => { request()
            .then(data => {setlaunchesApi(data)})
        }, []);
    }

    
     

    // var launches = launchesApi.results
    // console.log(launches)

    // for (const i of Array(10).keys()) {
    //     console.log(launchesApi.results)
    // }
    
    // x.forEach(launch => {
    //     console.log(launch)
    // });
    
    return(launchesData);
}

export default Data;
